#'duration': 2.4703867435455322, 'message': None, 'errors': [], 'extra_data': {'files_count': 1}
with app.app_context():
    from app.models import *
    repo = Repository(name="test",type="github",url="git@github.com:bmarsh9/portscanner.git",cred_id=1,is_private=False)
    scan = RepositoryScan(name="first scan")

    rel_keys = ['licenses', 'license_expressions', 'copyrights', 'holders', 'authors', 'packages', 'emails', 'urls', 'scan_errors']
    base_keys = ['path', 'type', 'name', 'base_name', 'extension', 'size', 'date', 'sha1', 'md5', 'sha256', 'mime_type', 'file_type', 'programming_language', 'is_binary', 'is_text', 'is_archive', 'is_media', 'is_source', 'is_script', 'percentage_of_license_text', 'is_legal', 'is_manifest', 'is_readme', 'is_top_level', 'is_key_file', 'files_count', 'dirs_count', 'size_count']

    duration = _result["headers"][0]["duration"]
    errors = _result["headers"][0]["errors"]
    message = _result["headers"][0]["message"]
    file_count = _result["headers"][0]["extra_data"]["files_count"]

    for scanned_file in _result["files"]:
        file = File()
        for key,value in scanned_file.items():
            if key in base_keys: # all keys w.o relationship
                setattr(file,key,value)
            elif key == "licenses":
                for license in value:
                    print(json.dumps(license,indent=4))
                    file.licenses.append(FileLicense(**license))
            elif key == "license_expressions":
                for expression in value:
                    file.license_expressions.append(FileLicenseExpression(value=expression))
            elif key == "copyrights":
                for copyright in value:
                    file.copyrights.append(FileCopyright(**copyright))
            elif key == "holders":
                for holder in value:
                    file.holders.append(FileHolder(**holder))
            elif key == "authors":
                for author in value:
                    file.authors.append(FileAuthor(**author))
            elif key == "packages":
                 for pkg in value:
                     file_package = FilePackage()
                     for pkg_key,pkg_value in pkg.items():
                         if pkg_key in ["dependencies"]: # foreign relationship
                             for dependency in pkg_value:
                                 pkg_dependency = PackageDependency(**dependency)
                                 file_package.dependencies.append(pkg_dependency)
                         else:
                             setattr(file_package,pkg_key,pkg_value)
                     file.packages.append(file_package)
            elif key == "emails":
                for email in value:
                    file.emails.append(FileEmail(**email))
            elif key == "urls":
                for url in value:
                    file.urls.append(FileUrl(**url))
            elif key == "scan_errors":
                file.scan_errors.append(FileScanError(errors=value))
        scan.files.append(file)

    repo.scans.append(scan)
    db.session.add(repo)
    db.session.commit()
